import sideimage from './sideimage.jpg'

const Registration = () => {
    return (
   <div className='container'>
   <div className='image--container'>
    <img src='sideimage' alt='jj' />
   </div>
   <div className='form--container'>
    <h2>Registration</h2>
    <p>Enter the details below</p>

   </div>

   </div>

    )
}
export default Registration;
